import React, { useContext, useState } from 'react';
import { AuthContext } from '../context/authContext';
import Logo from './logo';

const Incidencias = () => {
  const { setAuth } = useContext(AuthContext);
  const [incidencias, setIncidencias] = useState([
    { id: 'I105', detalle: 'Detalle de la incidencia I105' },
    { id: 'I106', detalle: 'Detalle de la incidencia I106' },
    { id: 'I107', detalle: 'Detalle de la incidencia I107' },
  ]);
  const [nuevaIncidencia, setNuevaIncidencia] = useState({
    id: '',
    idAsignacion: '',
    rut: '',
    descripcion: '',
    fecha: '',
  });

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setNuevaIncidencia(prev => ({ ...prev, [name]: value }));
  };

  const handleCrearIncidencia = () => {
    // Aquí iría la lógica para crear una nueva incidencia
    console.log('Nueva incidencia:', nuevaIncidencia);
  };

  const handleVolverAlPanel = () => {
    // Aquí iría la lógica para volver al panel principal
  };

  const styles = {
    container: {
      fontFamily: 'Arial, sans-serif',
      maxWidth: '800px',
      margin: '0 auto',
      padding: '20px',
    },
    title: {
      backgroundColor: '#4a5d23',
      color: 'white',
      padding: '10px',
      textAlign: 'center' ,
      marginBottom: '20px',
    },
    section: {
      backgroundColor: '#e6f3e6',
      padding: '20px',
      borderRadius: '5px',
      marginBottom: '20px',
    },
    input: {
      width: '100%',
      padding: '8px',
      marginBottom: '10px',
      borderRadius: '3px',
      border: '1px solid #ccc',
    },
    button: {
      padding: '10px',
      backgroundColor: '#4a5d23',
      color: 'white',
      border: 'none',
      borderRadius: '5px',
      cursor: 'pointer',
      fontSize: '16px',
      marginRight: '10px',
    },
    volverButton: {
      width: '100%',
      padding: '10px',
      backgroundColor: '#9b8250',
      color: 'white',
      border: 'none',
      borderRadius: '5px',
      cursor: 'pointer',
      fontSize: '16px',
    },
  };

  return (
    <div>
      < Logo/>
    <div style={styles.container}>
  
      <h1 style={styles.title}>INCIDENCIA</h1>
      <div style={styles.section}>
        <h2>VER MIS INCIDENCIAS</h2>
        {incidencias.map((incidencia) => (
          <div key={incidencia.id}>
            <span>{incidencia.id}</span>
            <button style={styles.button}>Ver + Detalles</button>
          </div>
        ))}
      </div>
      <div  style={styles.section}>
        <h2>CREAR INCIDENCIA</h2>
        <input
          style={styles.input}
          type="text"
          name="id"
          placeholder="ID INCIDENCIA"
          value={nuevaIncidencia.id}
          onChange={handleInputChange}
        />
        <input
          style={styles.input}
          type="text"
          name="idAsignacion"
          placeholder="ID ASIGNACION"
          value={nuevaIncidencia.idAsignacion}
          onChange={handleInputChange}
        />
        <input
          style={styles.input}
          type="text"
          name="rut"
          placeholder="RUT"
          value={nuevaIncidencia.rut}
          onChange={handleInputChange}
        />
        <input
          style={styles.input}
          type="text"
          name="descripcion"
          placeholder="DESCRIPCIÓN"
          value={nuevaIncidencia.descripcion}
          onChange={handleInputChange}
        />
        <input
          style={styles.input}
          type="date"
          name="fecha"
          placeholder="FECHA"
          value={nuevaIncidencia.fecha}
          onChange={handleInputChange}
        />
        <button style={styles.button} onClick={handleCrearIncidencia}>
          Crear incidencia
        </button>
      </div>
      <button style={styles.volverButton} onClick={handleVolverAlPanel}>
        VOLVER AL PANEL
      </button>
    </div>
    </div>
  );
};

export default Incidencias;
